import "../coinPage.css";
import React, { Component } from "react";

const Ind = props =>{
    return (
        <div className="indivcoin">
        <p>(icon) {props.name}  {props.symbol}</p>
        <p>Time</p>
        <p>Latest Price:</p>
        <p>{props.price_usd} {props.percent_change_1h}</p>
        <p>{props.price_btc}</p>
        <p>MarketCap: {props.market_cap_usd}</p>
        <p>(24h)Volume: {props.volume_usd}</p>
        <p>Current Supply: {this.state.coin[0].total_supply}</p>
        <p>Total Supply: {this.state.coin[0].max_supply}</p>
      </div>
    )
}


export default Ind;
